"use strict";(self.webpackChunkdummy_code_documentation=self.webpackChunkdummy_code_documentation||[]).push([[53],{1109:e=>{e.exports=JSON.parse('{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Tutorial Intro","href":"/docs/intro","docId":"intro"},{"type":"category","label":"Texto","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Posicion","href":"/docs/Cadenas/posicion","docId":"Cadenas/posicion"},{"type":"link","label":"Concatenar","href":"/docs/Cadenas/concatenar","docId":"Cadenas/concatenar"},{"type":"link","label":"TerminaCon","href":"/docs/Cadenas/terminaCon","docId":"Cadenas/terminaCon"},{"type":"link","label":"Incluye","href":"/docs/Cadenas/incluye","docId":"Cadenas/incluye"},{"type":"link","label":"IndiceDe","href":"/docs/Cadenas/indiceDe","docId":"Cadenas/indiceDe"},{"type":"link","label":"UltimoIndiceDe","href":"/docs/Cadenas/ultimoIndiceDe","docId":"Cadenas/ultimoIndiceDe"},{"type":"link","label":"Coincidir","href":"/docs/Cadenas/coincidir","docId":"Cadenas/coincidir"},{"type":"link","label":"CoincidirTodo","href":"/docs/Cadenas/coincidirTodo","docId":"Cadenas/coincidirTodo"},{"type":"link","label":"RellenarFin","href":"/docs/Cadenas/rellenarAlFinal","docId":"Cadenas/rellenarAlFinal"},{"type":"link","label":"RellenarInicio","href":"/docs/Cadenas/rellenarAlComienzo","docId":"Cadenas/rellenarAlComienzo"},{"type":"link","label":"Repetir","href":"/docs/Cadenas/repetir","docId":"Cadenas/repetir"},{"type":"link","label":"Reemplazar","href":"/docs/Cadenas/remplazar","docId":"Cadenas/remplazar"},{"type":"link","label":"Buscar","href":"/docs/Cadenas/buscar","docId":"Cadenas/buscar"},{"type":"link","label":"Cortar","href":"/docs/Cadenas/cortar","docId":"Cadenas/cortar"},{"type":"link","label":"Dividir","href":"/docs/Cadenas/dividir","docId":"Cadenas/dividir"},{"type":"link","label":"IniciaCon","href":"/docs/Cadenas/iniciaCon","docId":"Cadenas/iniciaCon"},{"type":"link","label":"Subcadena","href":"/docs/Cadenas/subcadena","docId":"Cadenas/subcadena"},{"type":"link","label":"aMinusculas","href":"/docs/Cadenas/aMinusculas","docId":"Cadenas/aMinusculas"},{"type":"link","label":"aMayusculas","href":"/docs/Cadenas/aMayusculas","docId":"Cadenas/aMayusculas"},{"type":"link","label":"aTexto","href":"/docs/Cadenas/aTexto","docId":"Cadenas/aTexto"},{"type":"link","label":"Limpiar","href":"/docs/Cadenas/limpiar","docId":"Cadenas/limpiar"},{"type":"link","label":"LimpiarFinal","href":"/docs/Cadenas/limpiarFinal","docId":"Cadenas/limpiarFinal"},{"type":"link","label":"LimpiarInicio","href":"/docs/Cadenas/limpiarInicio","docId":"Cadenas/limpiarInicio"}],"href":"/docs/category/texto"},{"type":"category","label":"Numeros","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Max","href":"/docs/tutorial-extras/Max","docId":"tutorial-extras/Max"},{"type":"link","label":"Min","href":"/docs/tutorial-extras/Min","docId":"tutorial-extras/Min"},{"type":"link","label":"NeN","href":"/docs/tutorial-extras/NeN","docId":"tutorial-extras/NeN"},{"type":"link","label":"InfinitoNegativo","href":"/docs/tutorial-extras/infinitoNegativo","docId":"tutorial-extras/infinitoNegativo"},{"type":"link","label":"InfinitoPositivo","href":"/docs/tutorial-extras/infinitoPositivo","docId":"tutorial-extras/infinitoPositivo"},{"type":"link","label":"EsFinito","href":"/docs/tutorial-extras/esFinito","docId":"tutorial-extras/esFinito"},{"type":"link","label":"aFlotante","href":"/docs/tutorial-extras/aFlotante","docId":"tutorial-extras/aFlotante"},{"type":"link","label":"esEntero","href":"/docs/tutorial-extras/esEntero","docId":"tutorial-extras/esEntero"},{"type":"link","label":"esNeN","href":"/docs/tutorial-extras/esNeN","docId":"tutorial-extras/esNeN"}],"href":"/docs/category/numeros"}]},"docs":{"Cadenas/aMayusculas":{"id":"Cadenas/aMayusculas","title":"aMayusculas","description":"Se utiliza para convertir una cadena de texto a may\xfasculas. Imagina que tienes una palabra o una frase en min\xfasculas y quieres convertirla a may\xfasculas.","sidebar":"tutorialSidebar"},"Cadenas/aMinusculas":{"id":"Cadenas/aMinusculas","title":"aMinusculas","description":"Se utiliza para convertir una cadena de texto a min\xfasculas. Imagina que tienes una palabra o una frase en may\xfasculas y quieres convertirla a min\xfasculas.","sidebar":"tutorialSidebar"},"Cadenas/aTexto":{"id":"Cadenas/aTexto","title":"aTexto","description":"Se utiliza para convertir cualquier cosa en una cadena de texto. Imagina que tienes algo, como un n\xfamero o un objeto, y quieres convertirlo en una cadena de texto para poder imprimirlo o mostrarlo en la consola.","sidebar":"tutorialSidebar"},"Cadenas/buscar":{"id":"Cadenas/buscar","title":"Buscar","description":"Se utiliza para buscar un patr\xf3n en una cadena de texto y devuelve la posici\xf3n de la primera coincidencia. Imagina que tienes una frase y quieres encontrar la posici\xf3n de una palabra espec\xedfica dentro de esa frase.","sidebar":"tutorialSidebar"},"Cadenas/coincidir":{"id":"Cadenas/coincidir","title":"Coincidir","description":"Imagina que tienes una bolsa llena de cartas y quieres encontrar todas las cartas que tienen un n\xfamero espec\xedfico. En lugar de revisar una por una, puedes usar un filtro para buscar todas las cartas que coinciden con ese n\xfamero en particular. Al final, obtendr\xe1s todas las cartas que cumplen con el criterio de b\xfasqueda.","sidebar":"tutorialSidebar"},"Cadenas/coincidirTodo":{"id":"Cadenas/coincidirTodo","title":"CoincidirTodo","description":"Imagina que tienes un texto largo con muchas palabras y quieres encontrar todas las palabras que cumplan con ciertas caracter\xedsticas, como todas las palabras de cuatro letras. En lugar de buscar manualmente una por una, puedes utilizar una herramienta que te ayude a encontrar todas las palabras que cumplan con ese criterio.","sidebar":"tutorialSidebar"},"Cadenas/concatenar":{"id":"Cadenas/concatenar","title":"Concatenar","description":"Se utiliza para combinar o unir dos o m\xe1s cadenas de texto en una sola cadena. Imagina que tienes dos o m\xe1s cadenas de texto y deseas unirlas para formar una cadena m\xe1s larga.","sidebar":"tutorialSidebar"},"Cadenas/cortar":{"id":"Cadenas/cortar","title":"Cortar","description":"Se utiliza para extraer una parte espec\xedfica de una cadena de texto sin modificar la cadena original. Imagina que tienes una frase y quieres obtener una parte espec\xedfica de esa frase.","sidebar":"tutorialSidebar"},"Cadenas/dividir":{"id":"Cadenas/dividir","title":"Dividir","description":"Se utiliza para dividir una cadena de texto en un arreglo de subcadenas, utilizando un separador especificado. Imagina que tienes una frase y quieres dividirla en palabras individuales.","sidebar":"tutorialSidebar"},"Cadenas/incluye":{"id":"Cadenas/incluye","title":"Incluye","description":"Imagina que tienes una caja de juguetes y quieres saber si esa caja contiene un juguete espec\xedfico. Para hacerlo, puedes revisar uno por uno los juguetes de la caja hasta encontrar el que est\xe1s buscando. Si lo encuentras, puedes decir que la caja contiene ese juguete.","sidebar":"tutorialSidebar"},"Cadenas/indiceDe":{"id":"Cadenas/indiceDe","title":"IndiceDe","description":"Imagina que tienes un libro y quieres encontrar en qu\xe9 p\xe1gina aparece una palabra espec\xedfica. Para hacerlo, puedes abrir el libro desde la primera p\xe1gina y revisar p\xe1gina por p\xe1gina hasta encontrar la palabra que est\xe1s buscando. Una vez que encuentras la palabra, puedes decir en qu\xe9 p\xe1gina est\xe1 ubicada.","sidebar":"tutorialSidebar"},"Cadenas/iniciaCon":{"id":"Cadenas/iniciaCon","title":"IniciaCon","description":"Se utiliza para verificar si una cadena de texto comienza con un valor espec\xedfico. Imagina que tienes una palabra y quieres saber si empieza con una letra o un conjunto de letras en particular.","sidebar":"tutorialSidebar"},"Cadenas/limpiar":{"id":"Cadenas/limpiar","title":"Limpiar","description":"Se utiliza para eliminar los espacios en blanco al inicio y al final de una cadena de texto. Imagina que tienes una cadena de texto con espacios en blanco extra y quieres eliminarlos.","sidebar":"tutorialSidebar"},"Cadenas/limpiarFinal":{"id":"Cadenas/limpiarFinal","title":"LimpiarFinal","description":"Se utiliza para eliminar los espacios en blanco al final de una cadena de texto. Imagina que tienes una cadena de texto con espacios en blanco al final y deseas eliminarlos.","sidebar":"tutorialSidebar"},"Cadenas/limpiarInicio":{"id":"Cadenas/limpiarInicio","title":"LimpiarInicio","description":"Se utiliza para eliminar los espacios en blanco al inicio de una cadena de texto. Imagina que tienes una cadena de texto con espacios en blanco al inicio y deseas eliminarlos.","sidebar":"tutorialSidebar"},"Cadenas/posicion":{"id":"Cadenas/posicion","title":"Posicion","description":"Este m\xe9todo toma un valor entero y devuelve una nueva cadena que consta de la \xfanica unidad de c\xf3digo UTF-16 ubicada en el desplazamiento especificado. Este m\xe9todo permite n\xfameros enteros positivos y negativos. Los enteros negativos cuentan hacia atr\xe1s desde el \xfaltimo car\xe1cter de cadena.","sidebar":"tutorialSidebar"},"Cadenas/rellenarAlComienzo":{"id":"Cadenas/rellenarAlComienzo","title":"RellenarInicio","description":"Imagina que tienes una cadena de texto y deseas agregar caracteres adicionales al inicio para que tenga una longitud espec\xedfica. Por ejemplo, si tienes el n\xfamero \\"5\\" y deseas que tenga una longitud de 4 d\xedgitos, puedes usar rellenarInicio() para agregar ceros al inicio y lograr ese resultado.","sidebar":"tutorialSidebar"},"Cadenas/rellenarAlFinal":{"id":"Cadenas/rellenarAlFinal","title":"RellenarFin","description":"Imagina que tienes una cadena de texto y quieres agregarle caracteres adicionales al final para que tenga una longitud espec\xedfica. Por ejemplo, si tienes la palabra \\"Hola\\" y quieres que tenga una longitud de 8 caracteres, puedes usar rellenarFin() para agregar espacios en blanco al final y lograr ese resultado.","sidebar":"tutorialSidebar"},"Cadenas/remplazar":{"id":"Cadenas/remplazar","title":"Reemplazar","description":"Este se utiliza para buscar y reemplazar una parte espec\xedfica de una cadena de texto por otra cadena o valor. Imagina que tienes una frase y quieres cambiar una palabra en particular por otra.","sidebar":"tutorialSidebar"},"Cadenas/repetir":{"id":"Cadenas/repetir","title":"Repetir","description":"Este m\xe9todo te permite crear una nueva cadena de texto al repetir una cadena existente m\xfaltiples veces. Imagina que tienes una palabra y quieres duplicarla varias veces para formar una nueva cadena m\xe1s larga.","sidebar":"tutorialSidebar"},"Cadenas/subcadena":{"id":"Cadenas/subcadena","title":"Subcadena","description":"Se utiliza para extraer una parte espec\xedfica de una cadena de texto. Imagina que tienes una frase y quieres obtener una porci\xf3n determinada de esa frase.","sidebar":"tutorialSidebar"},"Cadenas/terminaCon":{"id":"Cadenas/terminaCon","title":"TerminaCon","description":"El m\xe9todo determina si una cadena termina con los caracteres de una cadena espec\xedfica, devolviendo verdadero o falso seg\xfan corresponda.","sidebar":"tutorialSidebar"},"Cadenas/ultimoIndiceDe":{"id":"Cadenas/ultimoIndiceDe","title":"UltimoIndiceDe","description":"Imagina que tienes un libro y quieres encontrar en qu\xe9 p\xe1gina aparece la \xfaltima vez una palabra espec\xedfica. En lugar de comenzar desde la primera p\xe1gina y revisar p\xe1gina por p\xe1gina, esta vez puedes empezar desde la \xfaltima p\xe1gina y retroceder hasta encontrar la \xfaltima aparici\xf3n de la palabra. Una vez que encuentras la palabra, puedes decir en qu\xe9 p\xe1gina est\xe1 ubicada.","sidebar":"tutorialSidebar"},"intro":{"id":"intro","title":"Tutorial Intro","description":"Let\'s discover Docusaurus in less than 5 minutes.","sidebar":"tutorialSidebar"},"tutorial-extras/aFlotante":{"id":"tutorial-extras/aFlotante","title":"aFlotante","description":"","sidebar":"tutorialSidebar"},"tutorial-extras/esEntero":{"id":"tutorial-extras/esEntero","title":"esEntero","description":"","sidebar":"tutorialSidebar"},"tutorial-extras/esFinito":{"id":"tutorial-extras/esFinito","title":"EsFinito","description":"Determina si un valor es un n\xfamero finito o no. Retorna true si el valor es un n\xfamero finito y false si el valor es infinito, -infinito, NeN o cualquier otro valor no num\xe9rico.","sidebar":"tutorialSidebar"},"tutorial-extras/esNeN":{"id":"tutorial-extras/esNeN","title":"esNeN","description":"","sidebar":"tutorialSidebar"},"tutorial-extras/infinitoNegativo":{"id":"tutorial-extras/infinitoNegativo","title":"InfinitoNegativo","description":"Es un valor especial que representa el infinito negativo, es decir, el n\xfamero m\xe1s peque\xf1o posible que se puede representar, este valor se obtiene cuando se realiza una operaci\xf3n que resulta en un n\xfamero muy negativo o cuando se divide un n\xfamero negativo por cero.","sidebar":"tutorialSidebar"},"tutorial-extras/infinitoPositivo":{"id":"tutorial-extras/infinitoPositivo","title":"InfinitoPositivo","description":"Es un valor especial que representa el infinito positivo, es decir, el n\xfamero m\xe1s grande posible que se puede representar, este valor se obtiene cuando se realiza una operaci\xf3n que resulta en un n\xfamero muy grande o cuando se divide un n\xfamero positivo por cero.","sidebar":"tutorialSidebar"},"tutorial-extras/Max":{"id":"tutorial-extras/Max","title":"Max","description":"Representa el valor m\xe1s grande que se puede representar para un n\xfamero de punto flotante. En otras palabras, es el n\xfamero m\xe1ximo que se puede almacenar en una variable de tipo n\xfamero.","sidebar":"tutorialSidebar"},"tutorial-extras/Min":{"id":"tutorial-extras/Min","title":"Min","description":"Representa el n\xfamero m\xe1s peque\xf1o que se puede representar. Es el n\xfamero positivo m\xe1s cercano a cero, pero no puede representar el valor exacto de cero.","sidebar":"tutorialSidebar"},"tutorial-extras/NeN":{"id":"tutorial-extras/NeN","title":"NeN","description":"(No-es-Numero)","sidebar":"tutorialSidebar"}}}')}}]);